css:
.highlight.linter-warning .region {
  background: linear-gradient(to bottom, #ffaa2c 0%, rgba(255, 170, 44, 0.30000000000000004) 20%, rgba(255, 170, 44, 0.30000000000000004) 80%, #ffaa2c 100%);
  border-left: 2px solid #ffaa2c;
  border-right: 2px solid #ffaa2c;
}
.highlight.linter-error .region {
  background: linear-gradient(to bottom, #cc0000 0%, rgba(204, 0, 0, 0.30000000000000004) 20%, rgba(204, 0, 0, 0.30000000000000004) 80%, #cc0000 100%);
  border-left: 2px solid #cc0000;
  border-right: 2px solid #cc0000;
}
